<?php

function bytesFormat($bytes, $precision = 2): string
{
    $units = ['B', 'KB', 'MB', 'GB', 'TB'];

    $bytes = max($bytes, 0);
    $pow = ($bytes > 0) ? floor(log($bytes, 1024)) : 0;
    $pow = min($pow, count($units) - 1);
    $bytes /= pow(1024, $pow);

    return round($bytes, $precision) . ' ' . $units[$pow];
}

// Redirect if HTTP_USER_AGENT is not set
if (empty($_SERVER['HTTP_USER_AGENT'])) {
    header('Location: /');
    exit();
}

// Check PHP version for str_contains function
if (!function_exists('str_contains')) {
    die('Please upgrade your PHP version to 8 or above');
}

$isTextHTML = str_contains($_SERVER['HTTP_ACCEPT'] ?? '', 'text/html');
const BASE_URL = "https://your.domain.com:443"; // Replace with appropriate URL

$URL = BASE_URL . ($_SERVER['REQUEST_URI'] ?? '') . ($isTextHTML ? '/info' : '');

// Initialize cURL
$ch = curl_init();
curl_setopt_array($ch, [
    CURLOPT_URL => $URL,
    CURLOPT_RETURNTRANSFER => true,
    CURLOPT_HEADER => true,
    CURLOPT_TIMEOUT => 17,
    CURLOPT_USERAGENT => $_SERVER['HTTP_USER_AGENT'],
    CURLOPT_CUSTOMREQUEST => 'GET',
    CURLOPT_SSL_VERIFYHOST => false,
    CURLOPT_SSL_VERIFYPEER => false,
]);

$response = curl_exec($ch);
$header_text = substr($response, 0, strpos($response, "\r\n\r\n"));
$response_body = trim(str_replace($header_text, '', $response));
$user = json_decode($response_body, true);

